  return (
    <section className="">
    <Container>
        <Row>
            <Col lg='12' >
                <div className="thank-you"  >
                    <span><i class="ri-checkbox-circle-line"></i></span>
                    <h1 className=" mb-3 fw-semibold ">Thank You</h1>
                    <h3 className=" mb-3 fw-semibold ">Your booking has been confirmed.</h3>
                <Button className="btn pr  "><Link to='/home' >Back To Home</Link></Button>
                </div>  
            </Col>
        </Row>
    </Container>




      {/* <h1>Thank You!</h1>
      <h5>Your booking has been confirmed.</h5>
      <p>We look forward to seeing you soon.</p> */}
    </section>
  );
};

